import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate, Outlet } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import RegisterForm from './redux/RegisterForm';
import LoginForm from './redux/LoginForm';
import Contacts from './Contacts';
import Navigation from './Navigation';
import UserMenu from './redux/UserMenu';

const App = () => {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/registration" element={<RegisterForm />} />
        <Route path="/login" element={<LoginForm />} />
        <Route path="/contacts/*" element={<Contacts />} />
      </Routes>
      <UserMenu />
      <ToastContainer />
    </Router>
  );
};

export default App;
